  render() {  

    return (
      <div>
    <h1>Contact</h1>  
    <p>Registered Office </p>
    <p>TC No. 38/1537(2), M.G. Road,</p>
    <p>Near Baba Studio Mele Pazhavangadi </p>
    <p>OverBridge, Thiruvananthapuram, 695 036 </p>
    <p>Kerala, South India </p>
    <p>+91-471-4060619 | +91-94434-14916 </p>
    <p>info@conceptsolutions.in </p>
</div>
)
  }  
}  
export default Contact
